import {takeEvery} from 'redux-saga/effects'
import {GET_MY_LIST} from './actionTypes'


function* mySaga(){
  yield takeEvery(GET_MY_LIST,getList)
}

function* getList(){
  console.log('Zelda')
}

export default mySaga
